First of all, I would like to say thank you. You have helped us discover a bug in the way that we handle batch requests for 'actions' in the Java-Sdk. It seems that we are not handling the body of these 'actions' correctly and therefor they are being lost when added to a batch request. Unfortunately, this is a bit of a tough issue to fix in the SDK and will take some time. In the meantime I offer you this solution that should help your issue and thus make it so that you do not have to create your own custom class. Here you go:
``` Java
        final BatchRequestContent batchRequestContent = new BatchRequestContent();
        MessageMoveRequest request = graphClient.me()
                .messages("AAA=")
                .move(MessageMoveParameterSet.newBuilder().withDestinationId("deletedItems").build()).buildRequest();
        request.post();

        String requestId = batchRequestContent.addBatchRequestStep(request, HttpMethod.POST, request.body);

```
